import './App.css';
import React, { useState, useEffect } from 'react';
import client from './axiosConfig';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { AnimatePresence } from 'framer-motion';


// Components
import Slide from './components/slide';
import Features from './components/Features';
import Contact from './components/Contact';
import Register from './components/Register';
import Login from './components/Login';
import Header from './components/Header';
import CurrentHeader from './components/CurrentHeader';

function App({ setCurrentUser }) {
  const [currentUser, setCurrentUserState] = useState();
  const [currentSlide, setCurrentSlide] = useState(0);

  useEffect(() => {
    client.get("/api/user/")
      .then(res => {
        setCurrentUserState(true);
      })
      .catch(error => {
        console.error('Error fetching user', error);
        setCurrentUserState(false);
      });
  }, []);

  const submitLogout = (e) => {
    e.preventDefault();
    client.post('/api/logout/', {})
      .then(res => {
        setCurrentUserState(false);
        setCurrentUser(false);
      })
      .catch(error => {
        console.error('Error logging out:', error);
      });
  };

  const linkedin = () => {
    window.location.href = 'http://linkedin.com/in/samranahmed';
  };

  const slides = [
    {
      title: "AiDIN Copilot: AI-Powered Analytics, Accelerated",
      text: "Streamline workflows, get answers faster with AiDIN Copilot.",
      buttonText: "Learn More",
      onButtonClick: () => console.log("Learn More clicked"),
    },
    {
      title: "Data Aggregation Unlock Generative AI in Enterprises",
      text: "Read about new updates and enhancements coming to the AI platform for enterprise Analytics.",
      buttonText: "Read More",
      onButtonClick: () => console.log("Read More clicked"),
    }
  ];

  const handleNextSlide = () => {
    setCurrentSlide((prev) => (prev + 1) % slides.length);
  };

  const handlePreviousSlide = () => {
    setCurrentSlide((prev) => (prev - 1 + slides.length) % slides.length);
  };

  if (currentUser) {
    return (
      <div className='current-user-header'>
        <CurrentHeader submitLogout={submitLogout} />
        <div className="current-main-page">
          <img src="/media/pexels-googledeepmind-17485633.jpg" alt="Sample" />
        </div>
      </div>
    );
  }

  return (
    <div className="main-page">
      <div className='animation-container'>
        <div className='animation-container-text'>
          <h1><b>Enhance Your<br /> Analytics with AI</b></h1>
          <h3>Solve problems at the new speed of business with a <br /> trusted analytics platform.</h3>
          <div className='animation-container-button'>
            <button className='button learn-more'>Learn More</button>
            <button className='button watch-now' onClick={linkedin}>Watch Now</button>
          </div>
        </div>
      </div>
      <div className='second-column'>
        <AnimatePresence>
          <Slide
            key={currentSlide}
            title={slides[currentSlide].title}
            text={slides[currentSlide].text}
            buttonText={slides[currentSlide].buttonText}
            onButtonClick={slides[currentSlide].onButtonClick}
          />
        </AnimatePresence>
        <button onClick={handlePreviousSlide}>Previous</button>
        <button onClick={handleNextSlide}>Next</button>
      </div>
      <Header />
    </div>
  );
}

function RoutesConfig() {
  const [currentUser, setCurrentUser] = useState(false);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<App setCurrentUser={setCurrentUser} />} />
        <Route path="/register" element={<Register setCurrentUser={setCurrentUser} />} />
        <Route path="/login" element={<Login setCurrentUser={setCurrentUser} />} />
        <Route path="/features" element={<Features />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default RoutesConfig;
